import React from "react";
import EmergencyLogin from "../components/EmergencyLogin";
import Header from "../components/Header";
import Footer from "../components/Footer";

const Home = () =>{
    return(
        <div className="home">
            <Header/>
                <section className="homesection">
                    <h3 className="fw-bolder text-black">Welcome to MediLocker...</h3>
                    <p className="fw-light text-black">Store your documents securely</p>
                    <br />
                    <br />
                    <EmergencyLogin/>
                    <iframe src="https://docfilestores.s3.us-east-1.amazonaws.com/IRT_MODEL_QUESTION_PAPER_2023.docx" width="600" height="400"></iframe>

                </section>
            <Footer/>
        </div>
    )
}   


export default Home;
